import React from 'react';
import send from './send';
const Send = new send();

export default class load_page extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      testURL: 'http://localhost:3888',
      liveURL: 'fakeWebsiteForNow',
      URL: '',
    }
    
  }

  first_load = async () => {
    Send.post('/ViewContracts', '')
    .then(res => {
      console.log(res);

    })
    .catch(err => {
      console.log(err);
    });
  }

  fun = async () => {
    return new Promise(function(resolve, reject) {
      
    });
  }
  
}
